import { observer } from 'mobx-react-lite';
import React, { useState } from 'react';

const TypeBar = observer(() => {
    const [carTypes, setCarTypes] = useState(false)

    return (
        <div className='d-flex'>
            <div class="dropdown">
                <button onClick={()=>setCarTypes(!carTypes)} class="btn btn-secondary dropdown-toggle" type="button" >
                    Dropdown button
                </button>
                {carTypes ? 
                <ul  className ="dropup-menu">
                    <li><input type='checkbox' class="dropup-item fs-7" href="#">Action</input></li>
                    <li><input type='checkbox' class="dropup-item" href="#">Another action</input></li>
                    <li><input type='checkbox' class="dropup-item" href="#">Something else here</input></li>
                </ul> 
                : 
                <ul className = "dropdown-menu">
                    <li><a class="dropdown-item" href="#">Action</a></li>
                    <li><a class="dropdown-item" href="#">Another action</a></li>
                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                </ul>
                }
            </div>
        </div>
    );
});

export default TypeBar;
